script: |
  super -f text -I q3314.spq | sort > q3314.out

inputs:
  - name: q3314.spq
    data: |
      SELECT + 33 AS col0, + ( + - ( + 8 ) ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab2

outputs:
  - name: q3314.out
    data: |
      33	-8
      33	-8
      33	-8
      33	-8
      33	-8
      33	-8
      33	-8
      33	-8
      33	-8
